      end
      if true then
        break
      end
    end

    if SubString(s__StringSegments_s[this], i, i + s__StringSegments_dLen[this]) == s__StringSegments_delim[this] then
      if i - prev > 0 then
        -- a valid token
        s__StringSegments_count[this] = s__StringSegments_count[this] + 1
        i = i + s__StringSegments_dLen[this]
        prev = i
      end
      i = i + s__StringSegments_dLen[this]
      prev = i
    else
      i = i + 1
    end
  end
