  while true do
    if (i > 11) then
      break
    end
    if ((s__Escaper_hero[((s___EscaperArray_escapers[s__EscaperArray_escapers[(udg_escapers)] + (i)]))]) == U) then
      -- INLINED!!
      return true
    end
    i = i + 1
  end
  return false
end

