            end
            signX = -1
            while true do
              if (ramp or signX > 1) then
                break
              end
              otherX = x + LARGEUR_CASE * signX
              otherY = SaveTerrainRamps___y + LARGEUR_CASE * signY
              otherCliffLevel = GetTerrainCliffLevel(otherX, otherY)
