  while true do
    if (i > 11) then
      break
    end
    udg_drunk[i] = INITIAL_DRUNK
    i = i + 1
  end
  DRUNK_EFFECTS[1] = DRUNK_EFFECT_PETIT
  DRUNK_EFFECTS[2] = DRUNK_EFFECT_MOYEN
  DRUNK_EFFECTS[3] = DRUNK_EFFECT_GROS
end




